            r -= 64;
        } else {
            x >>= 64;
        }
        if (x & 0xFFFFFFFF > 0) { // Max value for uint32
            r -= 32;
        } else {
            x >>= 32;
        }
        if (x & 0xFFFF > 0) { // Max value for uint16
            r -= 16;
        } else {
            x >>= 16;
        }
        if (x & 0xFF > 0) { // Max value for uint8
            r -= 8;
